INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (2834, 2, "青空の下で謁見", "フリーマーケット会場", 5118061, 10118, 0, 0, 40, 7, 8, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "ペコリーヌとの出会い", 1, 91002);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (2835, 2, "未来の騎空団\nマスコット？", "フリーマーケット会場", 5118062, 10118, 0, 0, 40, 7, 8, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "マホとの出会い", 1, 91002);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (2837, 2, "お嬢さまからの\n緊急依頼", "ランドソル市街地", 5118063, 10118, 0, 0, 40, 7, 8, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "アキノとの出会い", 1, 91002);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (4108402, 2, "黄金色の悩みごと", "フリーマーケット会場", 5118064, 10118, 0, 0, 40, 18, 8, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "ジュンとの出会い", 1, 91002);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (4107402, 2, "白熱！　格闘大会！", "フリーマーケット会場", 5118065, 10118, 0, 0, 40, 18, 8, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "カオリとの出会い", 1, 91002);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (9000227, 2, "祭り太鼓はオーエドの華", "オーエド町", 5118066, 10118, 1, 0, 40, 16, 8, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "ニノンとの出会い", 1, 91002);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (2101181, 3, "人気者は遅れて\nやってくる", "フリーマーケット会場", 5118067, 10118, 0, 0, 40, 19, 8, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "スズナとの出会い", 1, 91002);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (4109402, 3, "巫女・ミーツ・魔法少女", "ランドソル市街地", 5118068, 10118, 0, 0, 40, 18, 8, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ナナカとの出会い", 1, 91002);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (4305402, 3, "ネズ耳は二度なくなる", "フリーマーケット会場", 5118069, 10118, 0, 0, 40, 18, 8, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "キャル＆コッコロとの出会い", 1, 91002);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (4101402, 3, "この出会いにカンパイ！", "ランドソル市街地", 5118070, 10118, 0, 0, 40, 18, 8, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ユカリとの出会い", 1, 91002);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (4106402, 3, "陰陽アンサンブル", "ランドソル市街地", 5118071, 10118, 0, 0, 40, 18, 8, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "アオイとの出会い", 1, 91002);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (2836, 3, "運試し十番勝負！", "フリーマーケット会場", 5118072, 10118, 1, 0, 40, 7, 8, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "シノブとの出会い", 1, 91002);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 1, "彼女たちの新たな日常", 0, 5118600, 10118, 0, 10145115, 0, 0, 0, 0, "オープニング", 0, 0);
